import './App.css';

function App() {
  return (
    <div className="App">
      <div className="container">
          <div className="block"><h1 className="bloc__text">text 1</h1></div>
          <div className="block"><h1 className="bloc__text">text 2</h1></div>
          <div className="block"><h1 className="bloc__text">text 3</h1></div>
      </div>
    </div>
  );
}

export default App;
